import '../style/QuizFinishedModal.css';

function QuizFinishedModal({ onClose }) {
    return (
        <div className="modal-overlay">
            <div className="modal-dialog">
                <div className="modal-content">
                    <div className="modal-header">
                        <h5 className="modal-title m-2">Congratulations!</h5>
                    </div>
                    <div className="modal-body">
                        <p>You have completed the quiz successfully.</p>
                    </div>
                    <div className="modal-footer">
                        <button type="button" variant="success" className="btn btn-secondary" onClick={onClose}>Close</button>
                    </div>
                </div>
            </div>
        </div>
    );
}
export default QuizFinishedModal;
